import React from 'react';
import './FormUsuario.css'

import '../App.css';

function Usuario() {
  return (
    <div>
      <div className="formUsuarios">
        <div className="container">
          <form action="">
            <label>Nome</label>
            <input type="text" className="nome" />
            <label>sobrenome</label>
            <input type="text" className="sobrenome" /> <br />
            <label>Login</label>
            <input type="text" className="login" />
            <label>Senha</label>
            <input type="Senha" className="Senha" />
            <button href="" className="BTM">Registrar</button>
          </form>
        </div>

      </div>



    </div>
  );
}

export default Usuario;
